function formatPrec(precomp) {
	var px = "";
	var py = "";
	px = px + "[";
	for ( var index = 0; index < precomp.length; index++) {
		px = px + "'" + precomp[index].coord[0].toString(35) + "'";
		if (index != (precomp.length - 1))
			px = px + ",";
	}
	px = px + "];";

	py = py + "[";
	for ( var index = 0; index < precomp.length; index++) {
		py = py + "'" + precomp[index].coord[1].toString(35) + "'";
		if (index != (precomp.length - 1))
			py = py + ",";
	}
	py = py + "];";

	return [ px, py ];
}
